import React from 'react';

class FormUserDetails extends Component {

    continue = e => {
        e.prevenDefault();
        this.props.nextStep();
    }

    render() { 
        const {values,handleChange} = this.props;
        return ( 
            <div>
                <input type="text" values = {values.firstName} onChange ={handleChange('firstName')}/>
            </div> 
        );

    }

}

export default FormUserDetails;
